    false,nt"url": null,nt"notes": "An estimated 84,850 acre-feet of water
    are required annually to maintain 23,231 acres of marsh currently developed on the
    Stillwater WMA. An additional 34,003 acre-feet of water are needed to maintain 10,915
    acres of natural lakes and marshes, and 560 acres of irrigated pasture, currently
    developed, require 1,144 acre-feet of water yearly. Proposed developments will require
    an additional 34,253 acre-feet of water each year, 29,166 acre-feet by proposed
    marsh developments, and 5,087 acre-feet of water by irrigated pastures.",nt"license_title":
